import React from 'react';
import Toolbar from './components/Toolbar'
import DatosPersonales from './components/MiCuenta/DatosPersonales'


function App() {
	const toolbarInfo={
		nombre: 'Valeria Peralta'
	}
	const userInfo={
		nombre: 'Valeria Peralta',
		email: 'vaperalta2018@gmail.com',
		tel: '3855843316',
		dni: '42889052',
		ooss: 'OSPE',
		nroSocio: '123456'
	}
	return (
		<div className="App">
			<Toolbar toolbarInfo={toolbarInfo}></Toolbar>
			<DatosPersonales userInfo={userInfo}></DatosPersonales>


		</div>
	);
}

export default App;
